BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "__EFMigrationsHistory" (
	"MigrationId"	TEXT NOT NULL,
	"ProductVersion"	TEXT NOT NULL,
	CONSTRAINT "PK___EFMigrationsHistory" PRIMARY KEY("MigrationId")
);
CREATE TABLE IF NOT EXISTS "Categories" (
	"Id"	INTEGER NOT NULL,
	"Name"	TEXT,
	"CreatedDate"	TEXT NOT NULL,
	CONSTRAINT "PK_Categories" PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "RunningTimes" (
	"Id"	INTEGER NOT NULL,
	CONSTRAINT "PK_RunningTimes" PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Movies" (
	"Id"	INTEGER NOT NULL,
	"Title"	TEXT,
	"Year"	INTEGER NOT NULL,
	"Director"	TEXT NOT NULL,
	"Cast"	TEXT NOT NULL,
	"Genre"	TEXT NOT NULL,
	"Notes"	TEXT NOT NULL,
	"RunningTimeId"	INTEGER,
	"Duration"	TEXT NOT NULL DEFAULT '0.0',
	"ImageUrl"	TEXT NOT NULL DEFAULT '',
	CONSTRAINT "FK_Movies_RunningTimes_RunningTimeId" FOREIGN KEY("RunningTimeId") REFERENCES "RunningTimes"("Id"),
	CONSTRAINT "PK_Movies" PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "RunningDays" (
	"Id"	INTEGER NOT NULL,
	"Name"	TEXT,
	"RunningTimeId"	INTEGER,
	CONSTRAINT "FK_RunningDays_RunningTimes_RunningTimeId" FOREIGN KEY("RunningTimeId") REFERENCES "RunningTimes"("Id"),
	CONSTRAINT "PK_RunningDays" PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "RunningHourAndMinutes" (
	"Id"	INTEGER NOT NULL,
	"Time"	TEXT NOT NULL,
	"RunningDayId"	INTEGER,
	CONSTRAINT "FK_RunningHourAndMinutes_RunningDays_RunningDayId" FOREIGN KEY("RunningDayId") REFERENCES "RunningDays"("Id"),
	CONSTRAINT "PK_RunningHourAndMinutes" PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "HangFire.Schema" (
	"Version"	integer NOT NULL
);
CREATE TABLE IF NOT EXISTS "HangFire.Job" (
	"Id"	INTEGER NOT NULL,
	"StateId"	integer,
	"StateName"	nvarchar(20) COLLATE NOCASE,
	"InvocationData"	nvarchar NOT NULL COLLATE NOCASE,
	"Arguments"	nvarchar NOT NULL COLLATE NOCASE,
	"CreatedAt"	datetime NOT NULL,
	"ExpireAt"	datetime,
	PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "HangFire.State" (
	"Id"	INTEGER NOT NULL,
	"JobId"	integer NOT NULL,
	"Name"	nvarchar(20) NOT NULL COLLATE NOCASE,
	"Reason"	nvarchar(100) COLLATE NOCASE,
	"CreatedAt"	datetime NOT NULL,
	"Data"	nvarchar COLLATE NOCASE,
	FOREIGN KEY("JobId") REFERENCES "HangFire.Job"("Id") ON UPDATE CASCADE ON DELETE CASCADE,
	PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "HangFire.JobParameter" (
	"Id"	INTEGER NOT NULL,
	"JobId"	integer NOT NULL,
	"Name"	nvarchar(40) NOT NULL COLLATE NOCASE,
	"Value"	nvarchar COLLATE NOCASE,
	FOREIGN KEY("JobId") REFERENCES "HangFire.Job"("Id") ON UPDATE CASCADE ON DELETE CASCADE,
	PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "HangFire.JobQueue" (
	"Id"	INTEGER NOT NULL,
	"JobId"	integer NOT NULL,
	"Queue"	nvarchar(50) NOT NULL COLLATE NOCASE,
	"FetchedAt"	datetime,
	PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "HangFire.Server" (
	"Id"	nvarchar(100) NOT NULL COLLATE NOCASE,
	"Data"	nvarchar COLLATE NOCASE,
	"LastHeartbeat"	datetime NOT NULL,
	PRIMARY KEY("Id")
);
CREATE TABLE IF NOT EXISTS "HangFire.List" (
	"Id"	INTEGER NOT NULL,
	"Key"	nvarchar(100) NOT NULL COLLATE NOCASE,
	"Value"	nvarchar COLLATE NOCASE,
	"ExpireAt"	datetime,
	PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "HangFire.Set" (
	"Id"	INTEGER NOT NULL,
	"Key"	nvarchar(100) NOT NULL COLLATE NOCASE,
	"Score"	float NOT NULL,
	"Value"	nvarchar(256) NOT NULL COLLATE NOCASE,
	"ExpireAt"	datetime,
	PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "HangFire.Counter" (
	"Id"	INTEGER NOT NULL,
	"Key"	nvarchar(100) NOT NULL COLLATE NOCASE,
	"Value"	smallint NOT NULL,
	"ExpireAt"	datetime,
	PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "HangFire.Hash" (
	"Id"	INTEGER NOT NULL,
	"Key"	nvarchar(100) NOT NULL COLLATE NOCASE,
	"Field"	nvarchar(100) NOT NULL COLLATE NOCASE,
	"Value"	nvarchar COLLATE NOCASE,
	"ExpireAt"	datetime COLLATE NOCASE,
	PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "HangFire.AggregatedCounter" (
	"Id"	INTEGER NOT NULL,
	"Key"	nvarchar(100) NOT NULL COLLATE NOCASE,
	"Value"	integer NOT NULL,
	"ExpireAt"	datetime,
	PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "AgeCategoryDetails" (
	"Id"	INTEGER NOT NULL,
	"AgeCategoryType"	TEXT NOT NULL,
	"TicketId"	INTEGER,
	"AgeCategoryUnits"	INTEGER,
	"UnitPriceForAgeCategory"	TEXT NOT NULL,
	"TotalPriceForAnAgeCategory"	TEXT NOT NULL,
	CONSTRAINT "PK_AgeCategoryDetails" PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Bookings" (
	"Id"	INTEGER NOT NULL,
	"MovieId"	INTEGER NOT NULL,
	"MovieBookedBy"	TEXT NOT NULL,
	"MovieBookedon"	TEXT NOT NULL,
	"BookedTime"	TEXT NOT NULL,
	"BookingOwnerEmail"	TEXT NOT NULL,
	"TotalBookedSeats"	INTEGER NOT NULL,
	CONSTRAINT "PK_Bookings" PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Seats" (
	"Id"	INTEGER NOT NULL,
	"Section"	TEXT NOT NULL,
	"ColumnNumber"	TEXT NOT NULL,
	"RowAlphabet"	TEXT NOT NULL,
	"BookingId"	INTEGER,
	CONSTRAINT "FK_Seats_Bookings_BookingId" FOREIGN KEY("BookingId") REFERENCES "Bookings"("Id"),
	CONSTRAINT "PK_Seats" PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Tickets" (
	"Id"	INTEGER NOT NULL,
	"BookingId"	INTEGER NOT NULL,
	"TotalNumberOfTicketsTobeBooked"	INTEGER NOT NULL,
	"TotalPricePerAgeCategories"	TEXT NOT NULL DEFAULT '0.0',
	CONSTRAINT "FK_Tickets_Bookings_BookingId" FOREIGN KEY("BookingId") REFERENCES "Bookings"("Id") ON DELETE CASCADE,
	CONSTRAINT "PK_Tickets" PRIMARY KEY("Id" AUTOINCREMENT)
);
CREATE UNIQUE INDEX IF NOT EXISTS "IX_Movies_RunningTimeId" ON "Movies" (
	"RunningTimeId"
);
CREATE INDEX IF NOT EXISTS "IX_RunningDays_RunningTimeId" ON "RunningDays" (
	"RunningTimeId"
);
CREATE INDEX IF NOT EXISTS "IX_RunningHourAndMinutes_RunningDayId" ON "RunningHourAndMinutes" (
	"RunningDayId"
);
CREATE INDEX IF NOT EXISTS "Job_IX_HangFire_Job_ExpireAt" ON "HangFire.Job" (
	"ExpireAt"	DESC
);
CREATE INDEX IF NOT EXISTS "Job_IX_HangFire_Job_StateName" ON "HangFire.Job" (
	"StateName"	DESC
);
CREATE INDEX IF NOT EXISTS "State_IX_HangFire_State_JobId" ON "HangFire.State" (
	"JobId"	DESC
);
CREATE INDEX IF NOT EXISTS "JobParameter_IX_HangFire_JobParameter_JobIdAndName" ON "HangFire.JobParameter" (
	"JobId"	DESC,
	"Name"	DESC
);
CREATE INDEX IF NOT EXISTS "JobQueue_IX_HangFire_JobQueue_QueueAndFetchedAt" ON "HangFire.JobQueue" (
	"Queue"	DESC,
	"FetchedAt"	DESC
);
CREATE INDEX IF NOT EXISTS "List_IX_HangFire_List_ExpireAt" ON "HangFire.List" (
	"ExpireAt"	DESC
);
CREATE INDEX IF NOT EXISTS "List_IX_HangFire_List_Key" ON "HangFire.List" (
	"Key"	DESC
);
CREATE INDEX IF NOT EXISTS "Set_IX_HangFire_Set_ExpireAt" ON "HangFire.Set" (
	"ExpireAt"	DESC
);
CREATE INDEX IF NOT EXISTS "Set_IX_HangFire_Set_Key" ON "HangFire.Set" (
	"Key"	DESC
);
CREATE UNIQUE INDEX IF NOT EXISTS "Set_UX_HangFire_Set_KeyAndValue" ON "HangFire.Set" (
	"Key"	DESC,
	"Value"	DESC
);
CREATE INDEX IF NOT EXISTS "Counter_IX_HangFire_Counter_Key" ON "HangFire.Counter" (
	"Key"	DESC
);
CREATE INDEX IF NOT EXISTS "Hash_IX_HangFire_Hash_ExpireAt" ON "HangFire.Hash" (
	"ExpireAt"	DESC
);
CREATE INDEX IF NOT EXISTS "Hash_IX_HangFire_Hash_Key" ON "HangFire.Hash" (
	"Key"	DESC
);
CREATE UNIQUE INDEX IF NOT EXISTS "Hash_UX_HangFire_Hash_Key_Field" ON "HangFire.Hash" (
	"Key"	DESC,
	"Field"	DESC
);
CREATE UNIQUE INDEX IF NOT EXISTS "AggregatedCounter_UX_HangFire_CounterAggregated_Key" ON "HangFire.AggregatedCounter" (
	"Key"	DESC
);
CREATE INDEX IF NOT EXISTS "IX_Seats_BookingId" ON "Seats" (
	"BookingId"
);
CREATE UNIQUE INDEX IF NOT EXISTS "IX_Tickets_BookingId" ON "Tickets" (
	"BookingId"
);
COMMIT;
